import React from "react";

export const containerStyle = {
  display: "flex",
  alignItems: "center",
  gap: "16px",
};

const StarRating = () => {
  return (
    <div style={containerStyle}>
      <div>
        {Array.from({ length: 10 }, (_, i) => {
          return <span>Season {i + 1} </span>;
        })}
      </div>
    </div>
  );
};

export default StarRating;
